// src/components/Experience.jsx
import React from 'react';
import './Experience.css';

const Experience = () => {
  return (
    <section id="experience" className="experience">
      <h2>Experience</h2>
      <div className="job">
        <h3>Software Engineer - Steepgraph Private Limited</h3>
        <p>Pune, India (Sep 2022 – Jul 2024)</p>
        <ul>
          <li>Developed CATIA/DELMIA 3D Experience wizards using CAA, EKL, and C/C++.</li>
          <li>Collaborated with cross-functional teams to create tailored solutions for clients.</li>
          <li>Engineered automated validation solutions for CATIA geometry and design models.</li>
        </ul>
      </div>
      <div className="job">
        <h3>Data Processing Specialist - Nielsen IQ</h3>
        <p>Vadodara, India (Aug 2021 – Aug 2022)</p>
        <ul>
          <li>Developed automated tools using Python (NumPy, Pandas, OpenCV) to enhance data processing.</li>
          <li>Executed database checks and improved data accuracy by 25%.</li>
          <li>Designed interactive dashboards using Power BI and Tableau for reporting insights.</li>
        </ul>
      </div>
    </section>
  );
}

export default Experience;
